// Captura os valores brutos das vari√°veis
const rawIdFatura = {{idfatura}}
const rawTotalFatura = {{totalfatura}}
const rawVencimento = {{faturavencimento}}
const rawResultado = {{resultadoFaturas}}

// Fun√ß√£o para extrair dados de string formatada como array
function extrairArrayDeString(str) {
  try {
    // Verifica se a string √© v√°lida
    if (!str) {
      return []
    }

    // Se j√° for um array, retorna diretamente
    if (Array.isArray(str)) {
      return str
    }

    // Tenta parsear como JSON se for string
    if (typeof str === 'string') {
      try {
        const parsed = JSON.parse(str)
        return Array.isArray(parsed) ? parsed : [parsed]
      } catch (e) {
        // Caso falhe, faz tratamento manual
        const limpo = str.replace(/^\[|\]$/g, '').trim()
        if (!limpo) return []

        return limpo.split(',').map(item => {
          return item.trim().replace(/^"|"$/g, '')
        })
      }
    }

    // Se nada funcionar, tenta converter para string e tratar
    return [String(str)]
  } catch (error) {
    return []
  }
}

// Extrai os dados
const idsFaturas = extrairArrayDeString(rawIdFatura)
const totaisFaturas = extrairArrayDeString(rawTotalFatura)
const vencimentosFaturas = extrairArrayDeString(rawVencimento)

// Emojis para usar na formata√ß√£o
const emojiDinheiro = "üí∞"
const emojiCalendario = "üìÖ"
const emojiRecibo = "üßæ"
const emojiLista = "üìã"
const emojiSeparador = "‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ"

// Verifica se tem dados para processar
let mensagem = `${emojiLista} *FATURAS EM ABERTO*\n\n`

if (idsFaturas.length === 0) {
  mensagem = "N√£o encontramos faturas em aberto para voc√™."
} else {
  // Adiciona cada fatura √† mensagem
  for (let i = 0; i < idsFaturas.length; i++) {
    // Formata a data de vencimento
    let dataFormatada = vencimentosFaturas[i] || "Data n√£o dispon√≠vel"
    try {
      if (vencimentosFaturas[i]) {
        const dataVencimento = new Date(vencimentosFaturas[i])
        dataFormatada = `${dataVencimento.getDate().toString().padStart(2, '0')}/${(dataVencimento.getMonth() + 1).toString().padStart(2, '0')}/${dataVencimento.getFullYear()}`
      }
    } catch (e) {
      // Mant√©m o formato original se houver erro
    }

    // Adiciona a fatura no formato solicitado
    mensagem += `${emojiRecibo} *N¬∫ Fatura: ${idsFaturas[i] || "N/A"}*\n`
    mensagem += `${emojiDinheiro} Valor: R$ ${totaisFaturas[i] || "0.00"}\n`
    mensagem += `${emojiCalendario} Vencimento: ${dataFormatada}\n`

    // Adiciona separador se n√£o for a √∫ltima fatura
    if (i < idsFaturas.length - 1) {
      mensagem += `\n${emojiSeparador}\n\n`
    }
  }
}

// Define a vari√°vel listaFaturas usando a fun√ß√£o setVariable
